import React from "react"
import './App.css';

class App extends React.Component {
  constructor(props){
    super(props)
    this.state = {
      users: []
    }
  }

  componentDidMount = () => {
    fetch('https://randomuser.me/api?results=25')
      .then(response => response.json())
      .then(data => this.setState({
        users: data.results
      }))
      .catch(error => console.log(`Error, ${error}`))
  }

  render() {
    return (
      <div>
        {this.state.users}
      </div>
    );
  }
}
export default App;
